    var sourceName = (
        db.collection("NBASources")
        .doc("n7CnddtjJjthvX9O5WcC")
        .name
    )
    return(
        <div className="TierItem">
            <h1>1</h1>
            <p>{sourceName}</p>
        </div>
    )
}

export default Tier1;
